import React from "react";
import data from "./data";

function Sort() {
  return (
    <>
      {window.sessionStorage.getItem("Bin") && (
        <div
          className="fillPage l"
          style={{
            display: "flex",
            justifyContent: "space-evenly",
            flexDirection: "column",
            padding: "0 100px",
          }}
        >
          <div className="cerinta">Afla linkul pentru urmatorul nivel!</div>
          <div className="re">
            <div className="filters"></div>
            <div className="links">
              {data.map((d) => {
                return (
                  <>
                    <div key={d.id} style={{ margin: "10px" }} className="nu">
                      <h5>{d.name}</h5>
                    </div>
                  </>
                );
              })}
            </div>
          </div>
        </div>
      )}
    </>
  );
}

export default Sort;
